-- ----------------------------
-- Procedure structure for refreshTreeNodes
-- ----------------------------
DROP PROCEDURE IF EXISTS `refreshTreeNodes`;
delimiter ;;
CREATE PROCEDURE `refreshTreeNodes`()
BEGIN

DECLARE LEVEL INT ;
SET LEVEL = 0 ; UPDATE t_sys_menu a
INNER JOIN (
	SELECT
		id,
		n_level,
		concat(',', ID, ',') scort
	FROM
		t_sys_menu
	WHERE
		pater_id IS NULL
) b ON a.id = b.id
SET a.n_level = b.n_level,
 a.scort = b.scort ;
WHILE FOUND_ROWS() > 0 DO
SET LEVEL = LEVEL + 1 ; UPDATE t_sys_menu a
INNER JOIN (
	SELECT
		ID,
		n_level,
		scort
	FROM
		t_sys_menu
	WHERE
		n_level = LEVEL - 1
) b ON a.pater_id = b.id
SET a.n_level = b.n_level,
 a.scort = concat(b.scort, a.ID, ',') ;
END
WHILE ;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
